const Web3 = require("web3");
const trace = require("./provider");


const web3 = new Web3("https://bsc-mainnet.nodereal.io/v1/661212fef6a7492899d8fad01785ed10");
const txHash = "0x1192fc77035544344218fbc5bdd4508dcf0febb5c31cccfa05df206ea01d7c3c"; // https://bscscan.com/tx/0x1192fc77035544344218fbc5bdd4508dcf0febb5c31cccfa05df206ea01d7c3c


provider = new trace.AsyncHttpProvider(web3.currentProvider);


(async ()=> {
  const resp = await provider.debug_traceTransaction(txHash);

  // dump the call stack
  let call = resp.result
  console.log(`from: ${call.from}`);
  console.log(`to: ${call.to}`);
  console.log(`method: ${call.input.slice(0, 10)}`);

  console.log(`\nSub calls:\n`);
  
  resp.result.calls.forEach(call => {
    console.log(`from: ${call.from}`);
    console.log(`to: ${call.to}`);
    console.log(`method: ${call.input.slice(0, 10)}\n`);
  });
})();


function chunkSubstr(str, size) {
  const numChunks = Math.ceil(str.length / size)
  const chunks = new Array(numChunks)

  for (let i = 0, o = 0; i < numChunks; ++i, o += size) {
    chunks[i] = str.substr(o, size)
  }

  return chunks
}
